function printSpec(entries, spec) {
  stylePage = '@page {size: landscape;}';
  styleFont = '* {font-family: Arial, sans-serif;} p, td, .signDiv{font-size:0.8em;}';
  styleContainer = '.cont {padding:1%;}';
  styleHeader = '.header {text-align:center;}';
  styleTR = 'tr {border-bottom: 2px solid black;}';
  styleTD = 'td {text-align:center; border-bottom: 1px solid lightgrey;}';
  styleHeaderLogo = '.header-logo {position:absolute; right:0; max-width: 25%;}';
  styleCaption = '.caption {text-align:center; max-width: 40%; margin:auto; margin-top:2%;}';
  styleTable = 'table {margin:auto;width:100%;margin-top:2%;}';
  styleThead = 'thead {background-color: lightgrey;}';
  styleTrSum = '.tr_sum {font-weight:bold; border:0; text-align:left;}';
  styleSignDiv = '.signDiv {display:flex; justify-content:space-between; margin-top:2%;}';
  styleSignDivChildren = '.signDiv div {display:flex; align-items:center; justify-content:center; width:15%; padding:2% 10%; border-bottom:1px solid black;}';
  style = stylePage + styleFont + styleContainer + styleHeaderLogo + styleHeader + styleCaption +
    styleTable + styleThead + styleTR + styleTD + styleTrSum + styleSignDiv + styleSignDivChildren;
  docStart = '<html><head><style>';
  docStart += style;
  docStart += '</style></head><body><div class="cont">';
  docEnd = "</body></html></div>";
  header = '<div class="header">';
  header += '<img src="' + tpl_logo + '" class="header-logo">';
  header += '<h3 style="display:inline; margin: auto;">Потврда за прием на пратки</h3><br>';
  header += spec.barcode;
  header += '</div>';
  caption = '<div style="text-align:center;"><p class="caption">Спецификација за превземени пратки од импорт листа ' +
        spec.barcode + ' на датум ' + spec.created_at.split(' ')[0] + '</p></div>';

  onLoadScript = "<script type='application/javascript'>window.onload = function(){window.print(); window.onfocus = function() {setTimeout(function(){window.close()},3);} } </script>";
  docEnd = onLoadScript + docEnd;

  sum = 0;
  ths = '<th>#</th><th>Сериски број</th><th>Примач</th><th>Адреса</th><th>Телефон</th><th>Тежина</th><th>Откуп</th>';
  trs = '';
  for(i = 0; i<entries.length; i++){
    trs += '<tr>';
    trs += '<td>' + (i + 1) + '</td>';
    trs += '<td>' + entries[i]['Сериски'] + '</td>';
    trs += '<td>' + entries[i]['Име на примач'] + '</td>';
    trs += '<td>' + entries[i]['Адреса на примач'] +', ' + entries[i]['Место на примач'] + '</td>';
    trs += '<td>' + entries[i]['Телефон на примач'] + '</td>';
    trs += '<td>' + entries[i]['Тежина'] + '</td>';
    trs += '<td>' + entries[i]['Повратен откуп'] + '</td>';
    trs += '</tr>';
    sum+= +entries[i]['Повратен откуп'];
  }

  tr_sum = '<tr><td colspan="5" class="tr_sum">Вкупно: ' +
    (entries.length+1) + '</td><td colspan="2" class="tr_sum">Вкупно: ' + sum + ' ден</td></tr>';

  sign_div = '<div class="signDiv"><div>Испраќач:</div><div>Курир:</div></div>';

  table = '<table><thead>' + ths + '</thead><tbody>' + trs + tr_sum +  '</tbody></table>';

  winHTML = docStart + header + caption + table + sign_div + docEnd;
  printWindow = window.open();
  printWindow.document.write(winHTML);
  printWindow.document.close();

}

